import React from "react";

function AboutMe() {
	return (
		<section>
			<h1>I'm Naail, a builder with a passion for strategic games.</h1>
			<p>
				In the past, I've studied computer science and engineering at MIT,
				worked as a software engineer at Two Sigma, and as a quantiative trader
				at IMC Trading and SIG.
			</p>
			<p>
				I'm a semi-professional poker player and MIT-trained computer scientist
			</p>
		</section>
	);
}

export default AboutMe;
